  backgroundSize: 'cover',
  backgroundRepeat: 'no-repeat',
  width: '500px',
  height: '500px'

}}>.</td>
<td style={{  
  backgroundImage: "url(" + "" + ")",
  backgroundPosition: 'center',
  backgroundSize: 'cover',
  backgroundRepeat: 'no-repeat',
  width: '100px',
  height: '500px',
  align: 'center'

}}>.</td>
      <td style={{  
  backgroundImage: "url(" + "" + ")",
  backgroundPosition: 'center',
  backgroundSize: 'cover',
  backgroundRepeat: 'no-repeat',
  width: '500px',
  height: '500px',
  align: 'center'

}}><CheckDiscountCard /></td>
      <td id="result" style={{  
  backgroundImage: "url(" + "" + ")",
  backgroundPosition: 'center',
  backgroundSize: 'cover',
  backgroundRepeat: 'no-repeat',
  align:'top',
  width: '370px',
  height: '500px'

}}>.</td>
    </tr>
  </table>
  <Footer />
</div> );
}

export default CheckDiscounts;
